  "translationLines": [
    {
      "lineNumber": 81441,
      "originalJapaneseLine": "「全てを忘れて……",
      "translatedEnglishLine": "\"Forget everything...\""
    },
    {
      "lineNumber": 81442,
      "originalJapaneseLine": "　私の胸の中で永遠の安寧に包まれるの」",
      "translatedEnglishLine": "Be wrapped in eternal peace within my chest.\""
    },
    {
      "lineNumber": 81443,
      "originalJapaneseLine": "「そこは、痛みも苦しみもない、",
      "translatedEnglishLine": "\"There is no pain or suffering there,"
    },
    {
      "lineNumber": 81444,
      "originalJapaneseLine": "　とても温かい世界よ……？」",
      "translatedEnglishLine": "A very warm world... okay?\""
    },
    {
      "lineNumber": 81445,
      "originalJapaneseLine": "「私のそばで……",
      "translatedEnglishLine": "\"Beside me..."
    },
    {
      "lineNumber": 81446,
      "originalJapaneseLine": "　絶望に包まれて眠りなさい」",
      "translatedEnglishLine": "Sleep enveloped in despair.\""
    },
    {
      "lineNumber": 81447,
      "originalJapaneseLine": "「そして、祈るの」",
      "translatedEnglishLine": "\"And pray.\""
    },
    {
      "lineNumber": 81448,
      "originalJapaneseLine": "「神の忘却がありますように、と――」",
      "translatedEnglishLine": "\"That God's forgetfulness may be upon you――\""
    },
    {
      "lineNumber": 81449,
      "originalJapaneseLine": "「あ、う……わた、わたし、は……」",
      "translatedEnglishLine": "\"Ah, uh... I, I am...\""
    },
    {
      "lineNumber": 81450,
      "originalJapaneseLine": "「もう何も怖がることはない……",
      "translatedEnglishLine": "\"There is nothing left to fear..."
    },
    {
      "lineNumber": 81451,
      "originalJapaneseLine": "　私の胸にいらっしゃい」",
      "translatedEnglishLine": "Come into my chest.\""
    },
    {
      "lineNumber": 81452,
      "originalJapaneseLine": "「永遠に――",
      "translatedEnglishLine": "\"Forever――"
    },
    {
      "lineNumber": 81453,
      "originalJapaneseLine": "甘やかしてあげる」",
      "translatedEnglishLine": "I will pamper you.\""
    },
    {
      "lineNumber": 81454,
      "originalJapaneseLine": "「アホか」",
      "translatedEnglishLine": "\"Are you an idiot?\""
    },
    {
      "lineNumber": 81455,
      "originalJapaneseLine": "「……あっ」",
      "translatedEnglishLine": "\"...Ah\""
    },
    {
      "lineNumber": 81456,
      "originalJapaneseLine": "「クリームさん、しっかりして下さい」",
      "translatedEnglishLine": "\"Cream-san, please pull yourself together.\""
    },
    {
      "lineNumber": 81457,
      "originalJapaneseLine": "「アムちゃんの言葉に惑わされるな。",
      "translatedEnglishLine": "\"Don't be misled by Amu-chan's words."
    },
    {
      "lineNumber": 81458,
      "originalJapaneseLine": "　いつも強気なクリームちゃんらしくないぞ」",
      "translatedEnglishLine": "This isn't like the confident Cream-chan we know.\""
    },
    {
      "lineNumber": 81459,
      "originalJapaneseLine": "「あ、私は……」",
      "translatedEnglishLine": "\"Ah, I...\""
    },
    {
      "lineNumber": 81460,
      "originalJapaneseLine": "「あら、なんで止めるのかしら」",
      "translatedEnglishLine": "\"Oh my, why are you stopping me?\""
    },
    {
      "lineNumber": 81461,
      "originalJapaneseLine": "「つまり幻覚のたぐい見ながら生きて、",
      "translatedEnglishLine": "\"In other words, you want me to live while seeing hallucinations,"
    },
    {
      "lineNumber": 81462,
      "originalJapaneseLine": "　アムちゃんの手足となって生きろってことだろ？」",
      "translatedEnglishLine": "and live as Amu-chan's hands and feet, right?\""
    },
    {
      "lineNumber": 81463,
      "originalJapaneseLine": "「くすくす……外の世界でどうあれ、",
      "translatedEnglishLine": "\"Hehe... No matter how the outside world is,"
    },
    {
      "lineNumber": 81464,
      "originalJapaneseLine": "　貴方自身は幸せしか感じないのに、",
      "translatedEnglishLine": "You yourself only feel happiness,"
    },
    {
      "lineNumber": 81465,
      "originalJapaneseLine": "　それでも不満？」",
      "translatedEnglishLine": "And yet you're still dissatisfied?\""
    },
    {
      "lineNumber": 81466,
      "originalJapaneseLine": "「別に不満があるわけでもないが……」",
      "translatedEnglishLine": "\"It's not that I have any complaints...\""
    },
    {
      "lineNumber": 81467,
      "originalJapaneseLine": "「殴りたい奴をブン殴らず、",
      "translatedEnglishLine": "\"Not hitting the person I want to punch,"
    },
    {
      "lineNumber": 81468,
      "originalJapaneseLine": "　泣き寝入りなんぞ冗談じゃない」",
      "translatedEnglishLine": "and just crying yourself to sleep is no joke.\""
    },
    {
      "lineNumber": 81469,
      "originalJapaneseLine": "「そう……十字架を背負って",
      "translatedEnglishLine": "\"Yes... carrying the cross on my back,"
    },
    {
      "lineNumber": 81470,
      "originalJapaneseLine": "　茨の道を進むの……」",
      "translatedEnglishLine": "I will walk the path of thorns...\""
    },
    {
      "lineNumber": 81471,
      "originalJapaneseLine": "「ふふふ、素敵ね。",
      "translatedEnglishLine": "\"Fufufu, that's wonderful."
    },
    {
      "lineNumber": 81472,
      "originalJapaneseLine": "　それはとてもランス君らしいわ」",
      "translatedEnglishLine": "That is very much like you, Rance-kun.\""
    },
    {
      "lineNumber": 81473,
      "originalJapaneseLine": "「やることは決まってる」",
      "translatedEnglishLine": "\"I know what I have to do.\""
    },
    {
      "lineNumber": 81474,
      "originalJapaneseLine": "「神をとっちめる」",
      "translatedEnglishLine": "\"I'm going to take down God.\""
    },
    {
      "lineNumber": 81475,
      "originalJapaneseLine": "「そんな……！",
      "translatedEnglishLine": "\"No way...!"
    },
    {
      "lineNumber": 81476,
      "originalJapaneseLine": "　相手は神様なのに、そんなこと――」",
      "translatedEnglishLine": "The opponent is God, yet you say such a thing――\""
    },
    {
      "lineNumber": 81477,
      "originalJapaneseLine": "「相手が神だろうとなんだろうと、",
      "translatedEnglishLine": "\"Whether the opponent is God or whatever,"
    },
    {
      "lineNumber": 81478,
      "originalJapaneseLine": "　俺様の敵になるなら、ブッ殺すだけだ」",
      "translatedEnglishLine": "If they're my enemy, I'll just kill them.\""
    },
    {
      "lineNumber": 81479,
      "originalJapaneseLine": "「クルックー、説明しろ。",
      "translatedEnglishLine": "\"Kurukku, explain."
    },
    {
      "lineNumber": 81480,
      "originalJapaneseLine": "　どうすれば神と会える」",
      "translatedEnglishLine": "How can I meet God?\""
    },
    {
      "lineNumber": 81481,
      "originalJapaneseLine": "「無理です。",
      "translatedEnglishLine": "\"It's impossible."
    },
    {
      "lineNumber": 81482,
      "originalJapaneseLine": "　やめて下さい」",
      "translatedEnglishLine": "Please stop.\""
    },
    {
      "lineNumber": 81483,
      "originalJapaneseLine": "「無理、というのは、",
      "translatedEnglishLine": "\"When you say impossible,"
    },
    {
      "lineNumber": 81484,
      "originalJapaneseLine": "　倒すのが無理って意味か？",
      "translatedEnglishLine": "Do you mean it's impossible to defeat,"
    },
    {
      "lineNumber": 81485,
      "originalJapaneseLine": "　それとも接触できないってことか？」",
      "translatedEnglishLine": "Or that we can't even make contact?\""
    },
    {
      "lineNumber": 81486,
      "originalJapaneseLine": "「その、それは……」",
      "translatedEnglishLine": "\"Th-that is...\""
    },
    {
      "lineNumber": 81487,
      "originalJapaneseLine": "「クルックー！",
      "translatedEnglishLine": "\"Kurukku!"
    },
    {
      "lineNumber": 81488,
      "originalJapaneseLine": "　ハッキリしろ！」",
      "translatedEnglishLine": "Be clear!\""
    },
    {
      "lineNumber": 81489,
      "originalJapaneseLine": "ランスがクルックーの小さな両肩を掴んですごむと、",
      "translatedEnglishLine": "Rance grabbed Kurukku's small shoulders and glared,"
    },
    {
      "lineNumber": 81490,
      "originalJapaneseLine": "クルックーは為す術なく、小さく目を逸らした。",
      "translatedEnglishLine": "Kurukku, helpless, averted his eyes slightly."
    }
  ]
}

